import React from 'react';
import { ThemeProvider, Button as MTButton } from "@material-tailwind/react";

function App() {
  return (
    <ThemeProvider>
      <div className="App">
        <MTButton color="blue">Test Button</MTButton>
      </div>
    </ThemeProvider>
  );
}

export default App;
